import React from "react";

const Header = () => {
  return (
    <header className="header">
      <div className="container">
        <div className="row">
            <h1>سرادق لتنظيم الفعاليات</h1>
            <p>
              مؤسسة سرادق ذات كفاءات وخبرات عالية في تقديم أفضل الخدمات
              الإبداعية في إدارة وتنظيم جميع الفعاليات
            </p>
        </div>
      </div>
    </header>
  );
};
export default Header;
